"use strict";

function threeEqualParts(arr) {
    function find(cnt) {
        let s = 0;
        for (let i = 0; i < arr.length; i++) {
            s += arr[i];
            if (s === cnt) {
                return i;
            }
        }
        return -1;
    }
    const n = arr.length;
    const [cnt, mod] = [Math.floor(arr.reduce((a, b) => a + b) / 3), arr.reduce((a, b) => a + b) % 3];
    if (mod) {
        return [-1, -1];
    }
    if (cnt === 0) {
        return [0, n - 1];
    }
    let i = find(1);
    let j = find(cnt + 1);
    let k = find(cnt * 2 + 1);
    while (k < n && arr[i] === arr[j] && arr[j] === arr[k]) {
        i++, j++, k++;
    }
    if (k === n) {
        return [i - 1, j];
    }
    return [-1, -1];
}
